import React from 'react';

function Nav() {
  return (
    <nav className="flex justify-center items-center h-16 bg-white shadow-md">
      <ul className="flex space-x-8 text-lg font-medium">
        <li className="hover:text-blue-500 cursor-pointer">about</li>
        <li className="hover:text-blue-500 cursor-pointer">projects</li>
        <li className="hover:text-blue-500 cursor-pointer">experiences</li>
        <li className="hover:text-blue-500 cursor-pointer">fun</li>
      </ul>
    </nav>
  );
}

export default Nav;
